import React, { Component } from 'react';

import NavBar from './NavBar/NavBar';
import Title from './Title/Title';
import './Header.css';

function Header(){

    return(
        <div className='header'>
            <Title />
            <NavBar handlePageChange={this.props.handlePageChange}/>
        </div>
        )

    }

export default Header;
